const base_url: string = 'http://localhost:5000';

export const Apis: any = {
  login: base_url + '/auth/login',
  signup: base_url + '/auth/signup',
  user: {
    getUserByEmail: base_url + '/user/?email=',
    getUserByToken: base_url + '/user/token/',
    pudate
  },
};
